const ProjectThumbnail = (props) => {
    return (
        <div key={project._id}>
            <h2>{project.projectname}</h2>
            <h3>{project.description}</h3>
            <button id={project._id} onClick={props.deleteTask}>Delete Project</button>
        </div>
    )
}

export default ProjectThumbnail
